import React from "react";
import { Col, Row, Container } from "../components/Grid";
import Portfolio from "../components/Portfolio";


const PortfolioPage = () => {
  return (
    <Container fluid>
        <Portfolio></Portfolio>
    </Container>
  );
};

export default PortfolioPage;
